package main

import "fmt"

func lengthOfLongestSubstring(s string) int {
	max := 0
	min := 0
	count := 0
	m := make(map[string]int, len(s))

	for i := 0; i < len(s); i++ {
		str := string(s[i])
		if m[str] != 0 {
			if max-min > count {
				count = max - min
			}

			if min < m[str] {
				min = m[str]
			}
		}

		max++
		m[str] = i + 1
	}

	if max-min > count {
		return max - min
	}

	return count
}

